"'''English to Anglo-Saxon dictionary'''" refers to an [[Index:Unpublished material|unpublished]] dictionary by [[J.R.R. Tolkien]], consisting of a group of more than 400 slips of entries for an English to [[Old English|Anglo-Saxon]] dictionary. The entries were arranged alphabetically according to Modern English. The papers are held at the [[Bodleian Library]], Manuscript Tolkien A 20/4.<ref>{{PE|15}}, p. 41</ref>

